**TypeScript Version:**  2.3.2

**Code**

```ts
type JoinModels<A, K extends string, B> = A & {
    [k in K]: B;
};

interface User {
    username: string;
}

interface Post {
    title: string;
}

type UserWithPosts = JoinModels<User, "posts", Post[]> | null;

let userWithPosts: UserWithPosts = null;
if (userWithPosts == null) {
    console.log(userWithPosts.posts[0].title);
}
```

**Expected behavior:**
`userWithPosts` should be narrowed to null;

**Actual behavior:**
No error occurs
